package org.argentumonline.server.aStar;public class Node {        public Location location;    double costFromStart;    double costToGoal;    double totalCost;    Node parent;        @Override	public boolean equals(Object o) {        if(o instanceof Node) {            return this.location.equals(((Node) o).location);        }        return false;    }        @Override    public int hashCode() {    	return this.location.x + this.location.y * 100;    }}